Paul McCartney (Beatles) - Wings Over America 5.1 DTS Upmix

This cd was created using Adobe Audition 1.5 and SurCode DTS version 1.0.21. The bin and cue files were generated by PowerISO 4.4.

This is the 1999 Japanese reissue of Wings Over America.

The discs were ripped securely through EAC, and converted into FLAC files through EAC. 

The files were then converted to wav files then Adobe was used to create the 6 channels. 

Finally, SurCode was used to encode to DTS surround sound.

Please note: The artwork that is included here is not from the Japanese 3 album set but from the 2 CD disc set. I did not have any artwork from the Japanese set, but the two discs encoded to 5.1 DTS follow the list from the two cd set.

I checked this out on my surround system and all 6 speakers are active.

Please leave a comment after you listen to this and let me know what you think. This is my third cd conversion to 5.1 DTS surround cd. I solicit constructive criticism, but please don't flame. 

This sounds great crancked up on my surround stereo so I thought I would share this with others. 

